const getEmail = (state = null, action)=>{

    const getFunc = ()=>{
        fetch("localhost:3001")
            .then(data => data.json())
            .then(console.log(data))
            .catch(err=> console.log("error: ", err))
    }

    getFunc()

}

export default getEmail
